import React, { Component } from "react";
import "./css/start.css";
import "./js/canvas-backgraund.js"
class Start extends Component {
  render() {
    return (
      <div className="section_center">
        <div className="backgraund">
          <div id="large-header" className="large-header">
            <canvas id="demo-canvas" />
            <h1 className="main-title">
              Connect <span className="thin">Three</span>
            </h1>
          </div>
        </div>
        <div className="container">
          <p>
            <span>ComputerBOX</span>-это сервис, позволяющий быстро собрать
            компьютер
            <br /> по своим критериям.
          </p>
          <p>Начинай собирать его прямо сейчас</p>
          <p>Нажимай на нужную деталь</p>
        </div>
      </div>
    );
  }
}
export default Start;
